import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';
import '../css/foundation/assets/css/foundation.css';


const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <ul className='dropdown menu' data-dropdown-menu>
      <li>
        <a href='#'> Item 1 </a>
        <ul className='menu'>
          <li> <a href='#'> Item 1A </a> </li>
          <li> <a href='#'> Item 2A </a> </li>
          <li> <a href='#'> Item 3A </a> </li>
          <li>
            <a href='#'> Item 4A </a>
            <ul className='menu'>
              <li><a href='#'>Item 1B</a></li>
              <li><a href='#'>Item 2B</a></li>
              <li><a href='#'>Item 3B</a></li>
              <li><a href='#'>Item 4B</a></li>
            </ul>
          </li>
        </ul>
      </li>
      <li> <a href='#'>Item 2</a></li>
      <li> <a href='#'>Item 3</a></li>
      <li> <a href='#'>Item 4</a></li>
    </ul>
    // <div className='top-bar'>
    //   <div className='title-bar-left' data-responsive-toggle='example-menu' data-hide-for='large' >
    //     <button className='menu-icon' data-toggle></button>
    //     <ul id='example-menu' className="menu large-horizontal" data-responsive-menu='drilldown medium-dropdown' data-accordion-menu>
    //       <Services />
    //       <About />
    //       <Philantrophy />
    //     </ul>
    //   </div>

    //   <div className='title-bar-right'>
    //     <img
    //       src={logo}
    //       className="nav-logo small-1 medium-1 large-1"
    //       alt="Logo"
    //       onClick={scrollToTop}
    //     />
    //   </div>
    // </div>
  );
}

export default Navbar;
